-- Table structure for card
-- ----------------------------
DROP TABLE IF EXISTS `card`;
CREATE TABLE `card` (
  `id` bigint(20) NOT NULL COMMENT 'ID',
  `tenant_id` int(11) NOT NULL COMMENT '租户ID',
  `store_id` bigint(20) NOT NULL COMMENT '门店ID',
  `customer_id` bigint(20) NOT NULL COMMENT '客户ID',
  `template_id` bigint(20) NOT NULL COMMENT '卡种ID',
  `type` tinyint(4) NOT NULL COMMENT '类型(1储值卡，2计次卡，3折扣卡)',
  `scope` tinyint(4) NOT NULL COMMENT '适用范围(1单店，2连锁)',
  `expire_date` date NOT NULL COMMENT '到期日期',
  `number` varchar(20) COLLATE utf8_bin NOT NULL COMMENT '卡号',
  `password_hash` char(60) COLLATE utf8_bin NOT NULL COMMENT '密码',
  `price` decimal(11,2) DEFAULT '0.00' COMMENT '价格(元)',
  `amount` decimal(10,2) NOT NULL COMMENT '金额(元)',
  `balance` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '余额(元)',
  `recharge_amount_balance` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '充值余额(元)',
  `recharge_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '充值金额(元)',
  `give_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '赠送金额(元)',
  `give_balance` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '赠送剩余金额(元)',
  `status` tinyint(4) NOT NULL COMMENT '状态(1有效、10已退卡、20已挂失、30已作废)',
  `user_id` int(11) NOT NULL COMMENT '建档人',
  `consume_times` int(11) NOT NULL DEFAULT '0' COMMENT '消费次数(开单结算次数)',
  `note` varchar(255) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '备注',
  `create_time` datetime NOT NULL COMMENT '开卡时间',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `tenant_id` (`tenant_id`),
  KEY `customer_id` (`customer_id`),
  KEY `number` (`number`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='会员卡';

