  `limit_num` tinyint(4) NOT NULL DEFAULT '0' COMMENT '限制购买数量',
  `pic1` varchar(120) COLLATE utf8mb4_bin NOT NULL COMMENT '页面头部图片',
  `content` text COLLATE utf8mb4_bin NOT NULL COMMENT '内容',
  `tel` varchar(15) COLLATE utf8mb4_bin NOT NULL COMMENT '咨询电话',
  `record_plate_number` tinyint(4) NOT NULL DEFAULT '0' COMMENT '登记车牌号(1登记，0不登记)',
  `record_customer_name` tinyint(4) NOT NULL DEFAULT '0' COMMENT '登记客户名称(1登记，0不登记)',
  `record_customer_tel` tinyint(4) NOT NULL DEFAULT '0' COMMENT '登记客户手机号(1登记，0不登记)',
  `check_time_type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '核销时间类型(1长期有效, 2有效天数, 3有效期)',
  `check_end_time` date DEFAULT NULL COMMENT '核销截止时间',
  `check_valid_day` smallint(6) NOT NULL DEFAULT '0' COMMENT '有效天数',
  `share_rebate_amount` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '分享返利金额',
  `virtual_join_num` int(11) NOT NULL DEFAULT '0' COMMENT '伪造参与人数',
  `virtual_share_num` int(11) NOT NULL DEFAULT '0' COMMENT '伪造分享人数',
  `virtual_order_num` int(11) NOT NULL DEFAULT '0' COMMENT '伪造购买人数',
  `show_invitation` tinyint(4) NOT NULL DEFAULT '1' COMMENT '展示邀请排行榜(1开启，0关闭)',
  `show_store` tinyint(4) NOT NULL DEFAULT '1' COMMENT '展示门店信息(1开启，0关闭)',
  `show_order` tinyint(4) NOT NULL DEFAULT '1' COMMENT '展示购买记录(1开启，0关闭)',
  `bgm` varchar(255) COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '背景音乐',
  `status` tinyint(4) NOT NULL COMMENT '状态(1启用，0禁用，2删除 )',
  `share_title` varchar(255) COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '活动分享标题',
  `share_pic` varchar(255) COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '分享图标',
  `share_description` varchar(40) COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '活动分享描述',
  `poster_pic` varchar(255) COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '海报',
  `poster_pic_location` varchar(255) COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '海报位置[x,y]',
  `poster_head_location` varchar(255) COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '海报头像位置[x,y,长,宽]',
  `poster_qr_location` varchar(255) COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '海报二维码位置[x,y,长,宽]',
  `poster_font_location` varchar(255) COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '海报字体位置[x,y]',
  `poster_font_size` decimal(5,1) NOT NULL DEFAULT '12.0' COMMENT '海报字体大小',
  `poster_font_color` varchar(255) COLLATE utf8mb4_bin NOT NULL DEFAULT '#000000' COMMENT '海报字体颜色(16进制)',
  `create_time` datetime NOT NULL COMMENT '添加时间',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `tenant_id` (`tenant_id`),
  KEY `marketing_merchant_id` (`marketing_merchant_id`)
