-- ----------------------------
-- Table structure for repair_order
-- ----------------------------
DROP TABLE IF EXISTS `repair_order`;
CREATE TABLE `repair_order` (
  `id` bigint(20) NOT NULL COMMENT 'ID',
  `tenant_id` int(11) NOT NULL COMMENT '租户ID',
  `store_id` bigint(20) NOT NULL COMMENT '门店ID',
  `number` char(20) COLLATE utf8_bin NOT NULL COMMENT '订单编号',
  `type` tinyint(4) NOT NULL COMMENT '类型(1快捷开单、2洗车单、3销售单、4维修单)',
  `customer_id` bigint(20) NOT NULL COMMENT '客户ID',
  `vehicle_id` bigint(20) NOT NULL COMMENT '车辆ID',
  `person` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '送修人',
  `tel` varchar(20) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '联系电话',
  `mileage` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '进店里程数',
  `last_mileage` varchar(12) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '上次里程数',
  `next_maintain_date` date DEFAULT NULL COMMENT '下次保养日期',
  `last_maintain_date` date DEFAULT NULL COMMENT '上次保养日期',
  `next_maintain_mileage` varchar(12) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '下次保养里程',
  `last_maintain_mileage` varchar(12) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '上次保养里程',
  `oil_meter` tinyint(4) NOT NULL DEFAULT '0' COMMENT '油表(0未知，1空，2小于四分之一，3四分之一，4二分之一，5四分之三，6满)',
  `status` smallint(6) NOT NULL COMMENT '状态(12000待结账，15000已结账，20000已取消)',
  `repair_status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '维护状态(0待维护，10已完成)',
  `receive_status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '领料状态(0待领取，10已领取)',
  `repair_finish_time` datetime DEFAULT NULL COMMENT '维护完成时间',
  `expect_repair_finish_time` datetime DEFAULT NULL COMMENT '预估维护完成时间',
  `total_amount` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '总金额(元)',
  `card_deductible_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '会员卡抵扣金额(元)',
  `discount_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '优惠金额(元)',
  `receipt_method` int(11) NOT NULL DEFAULT '0' COMMENT '收款方式',
  `card_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '会员卡ID',
  `card_pay_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '会员卡支付金额(元)',
  `card_pay_give_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '会员卡支付金额(赠送支付)(元)',
  `card_pay_recharge_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '会员卡支付金额(充值支付)(元)',
  `card_discount_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '会员卡折扣金额(元)',
  `business_category_id` bigint(20) NOT NULL COMMENT '业务类型ID',
  `custom_discount_amount` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '手动优惠（自定义优惠）金额(元)',
  `mall_order_deductible_amount` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '商城订单商品抵扣金额(元)',
  `user_id` int(11) NOT NULL COMMENT '销售人ID',
  `operate_user_id` int(11) DEFAULT NULL COMMENT '操作人ID',
  `adviser_id` int(11) DEFAULT NULL COMMENT '服务顾问ID',
  `vehicle_check_order_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '查车单ID',
  `order_date` datetime DEFAULT NULL COMMENT '下单日期',
  `incoming_time` datetime DEFAULT NULL COMMENT '进厂时间',
  `settle_time` datetime DEFAULT NULL COMMENT '结算时间',
  `note` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注(故障描述)',
  `repair_advise` varchar(200) COLLATE utf8_bin DEFAULT '' COMMENT '维修建议',
  `repair_note` varchar(200) COLLATE utf8_bin DEFAULT '' COMMENT '维修故障备注',
  `anti_settle_times` int(11) DEFAULT '0' COMMENT '反结算次数',
  `note_level` tinyint(4) DEFAULT NULL COMMENT '备注等级（1,2,3,4）',
  `level_note` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  `create_time` datetime NOT NULL COMMENT '添加时间',
  `status_time` datetime NOT NULL COMMENT '状态时间',
  `upload_status` tinyint(4) DEFAULT '0' COMMENT '上传状态(0待上传，1已上传, 20校验不通过)',
  `upload_time` datetime DEFAULT NULL COMMENT '上传时间',
  `upload_note` varchar(255) COLLATE utf8_bin DEFAULT '' COMMENT '上传结果',
  PRIMARY KEY (`id`),
  UNIQUE KEY `number` (`number`),
  KEY `customer_id` (`customer_id`),
  KEY `vehicle_id` (`vehicle_id`),
  KEY `create_time` (`create_time`),
  KEY `tenant_id` (`tenant_id`,`store_id`),
  KEY `order_date` (`order_date`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='维修单';

