DROP TABLE IF EXISTS `reservation_order`;
CREATE TABLE `reservation_order` (
  `id` int(11) NOT NULL COMMENT 'ID',
  `tenant_id` int(11) NOT NULL COMMENT '租户ID',
  `store_id` bigint(20) NOT NULL COMMENT '门店ID',
  `number` char(20) NOT NULL COMMENT '订单编号',
  `repair_order_number` char(20) DEFAULT NULL COMMENT '维修订单编号',
  `customer_id` bigint(20) NOT NULL COMMENT '客户ID',
  `vehicle_id` bigint(20) NOT NULL COMMENT '车辆ID',
  `note` varchar(255) NOT NULL COMMENT '预约内容',
  `remark` varchar(255) DEFAULT '' COMMENT '备注',
  `order_note` varchar(255) NOT NULL DEFAULT '' COMMENT '订单备注',
  `customer_note` varchar(255) NOT NULL DEFAULT '' COMMENT '客户备注',
  `type` tinyint(4) NOT NULL DEFAULT '2' COMMENT '预约类型(1微信，2电话)',
  `status` tinyint(4) NOT NULL DEFAULT '10' COMMENT '状态(10已确认，20已下单，30待确认，40已取消)',
  `notify_status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '通知状态(0未通知，1未过期通知，2已过期通知)',
  `expiring_notify` tinyint(4) NOT NULL DEFAULT '0' COMMENT '临到期是否通知（0未通知，1已通知）',
  `total_amount` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '金额(元)',
  `card_deductible_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '会员卡抵扣金额(元)',
  `card_discount_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '会员卡折扣金额(元)',
  `custom_discount_amount` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '手动优惠（自定义优惠）金额(元)',
  `mall_order_deductible_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商城订单商品抵扣金额(元)',
  `business_category_id` bigint(20) NOT NULL COMMENT '业务类型ID',
  `user_id` int(11) NOT NULL COMMENT '销售人ID',
  `adviser_id` int(11) DEFAULT NULL COMMENT '服务顾问ID',
  `order_date` datetime DEFAULT NULL COMMENT '下单日期',
  `reservation_time` datetime NOT NULL COMMENT '预约时间',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `number` (`number`),
  KEY `tenant_id` (`tenant_id`),
  KEY `store_id` (`store_id`),
  KEY `customer_id` (`customer_id`),
  KEY `vehicle_id` (`vehicle_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='预约单';

