  `district_id` int(11) NOT NULL COMMENT '区县',
  `address` varchar(120) COLLATE utf8mb4_bin NOT NULL COMMENT '详细地址',
  `person_in_charge` varchar(20) COLLATE utf8mb4_bin NOT NULL COMMENT '门店负责人',
  `contact_name` varchar(20) COLLATE utf8mb4_bin NOT NULL COMMENT '联系人',
  `tel` varchar(41) COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '联系电话',
  `status` smallint(6) NOT NULL DEFAULT '1' COMMENT '状态(0关闭，1开启)',
