  `customer_id` bigint(20) NOT NULL COMMENT '所属客户ID',
  `member_vehicle_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '会员用户车辆ID',
  `plate_number` varchar(10) COLLATE utf8_bin NOT NULL COMMENT '车牌号',
  `vin` char(17) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '车架号',
  `licensing_date` date DEFAULT NULL COMMENT '上牌日期',
  `mileage` varchar(12) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '里程数',
  `car_id` varchar(500) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '具体车型ID',
  `car_type_id` int(11) NOT NULL DEFAULT '0' COMMENT '汽车车型ID',
  `car_model_year` smallint(6) NOT NULL DEFAULT '0' COMMENT '车年款',
  `car_displacement` varchar(30) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '车排量(升)',
  `car_name` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '车型名称',
  `category_id` bigint(20) NOT NULL COMMENT '车辆分类',
  `repair_times` smallint(6) NOT NULL DEFAULT '0' COMMENT '进厂次数',
  `user_id` int(11) NOT NULL COMMENT '建档人',
  `note` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  `annual_survey_date` date DEFAULT NULL COMMENT '年检到期时间',
  `next_maintain_date` date DEFAULT NULL COMMENT '下次保养日期',
  `wechat_notification_date` date DEFAULT NULL COMMENT '微信通知时间',
  `create_time` datetime NOT NULL COMMENT '添加时间',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `register_date` date DEFAULT NULL COMMENT '注册日期(行驶证注册日期)',
  `issue_date` date DEFAULT NULL COMMENT '发证日期(行驶证发证日期)',
  `engine_number` varchar(30) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '发动机号',
  `last_maintain_date` date DEFAULT NULL COMMENT '上次保养日期',
  `last_maintain_mileage` varchar(12) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '上次保养里程',
  `next_maintain_mileage` varchar(12) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '下次保养里程',
  `bussiness_insurance_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '保险（商业险）id',
  `compulsory_insurance_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '保险（交强险）id',
  `bussiness_insurance_expire_date` date DEFAULT NULL COMMENT '保险（商业险）过期时间',
  `compulsory_insurance_expire_date` date DEFAULT NULL COMMENT '保险（交强险）过期时间',
  `color` varchar(10) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '车身颜色',
  `production_year` varchar(10) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '生产年份',
  `guiding_price` varchar(12) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '厂商指导价（元）',
  `engine_oil` int(11) NOT NULL DEFAULT '0' COMMENT '机油',
  `fuel_oil` int(11) NOT NULL DEFAULT '0' COMMENT '燃油',
  `gearbox` varchar(30) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '变速箱型号',
  `production_category` int(11) NOT NULL DEFAULT '0' COMMENT '车辆产地类型（国产合资进口）',
  `first_entry_date` date DEFAULT NULL COMMENT '首次进厂日期',
  `final_entry_date` date DEFAULT NULL COMMENT '最后进厂日期',
  `tyre_brand_id` int(11) NOT NULL DEFAULT '0' COMMENT '轮胎品牌id',
  `tyre_type_id` int(11) NOT NULL DEFAULT '0' COMMENT '轮胎型号id',
  `travel_license_pic1` varchar(120) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '行驶证正本图片',
  `travel_license_pic2` varchar(120) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '行驶证副本图片',
  `travel_license_expire_date` date DEFAULT NULL COMMENT '行驶证过期日期',
  PRIMARY KEY (`id`),
  KEY `tenant_id` (`tenant_id`),
  KEY `customer_id` (`customer_id`),
  KEY `plate_number` (`plate_number`),
  KEY `vin` (`vin`),
  KEY `create_time` (`create_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='车辆档案';

