-- ----------------------------
-- Table structure for vehicle_check_order
-- ----------------------------
DROP TABLE IF EXISTS `vehicle_check_order`;
CREATE TABLE `vehicle_check_order` (
  `id` bigint(20) NOT NULL COMMENT 'ID',
  `tenant_id` int(11) NOT NULL COMMENT '租户ID',
  `store_id` bigint(20) NOT NULL COMMENT '所属门店',
  `number` char(20) COLLATE utf8_bin NOT NULL COMMENT '单号',
  `customer_id` bigint(20) NOT NULL COMMENT '客户ID',
  `vehicle_id` bigint(20) NOT NULL COMMENT '车辆ID',
  `mileage` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '进店里程数',
  `oil_meter` tinyint(4) NOT NULL DEFAULT '0' COMMENT '油表(0未知，1空，2小于四分之一，3四分之一，4二分之一，5四分之三，6满)',
  `appearance_view` tinyint(4) NOT NULL DEFAULT '0' COMMENT '外观环视图',
  `appearance_data` varchar(510) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '外观数据',
  `user_id` int(11) NOT NULL COMMENT '员工ID',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态（1正常，5待确认）',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `customer_remarks` varchar(256) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '车主备注',
  `note` varchar(255) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '备注',
  `voice_note` mediumtext COLLATE utf8_bin COMMENT '声音备注',
  `signature_point` mediumtext COLLATE utf8_bin COMMENT '签名数据',
  PRIMARY KEY (`id`),
  UNIQUE KEY `number` (`number`),
  KEY `tenant_id` (`tenant_id`),
  KEY `store_id` (`store_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='查车单';

