INSERT INTO `marketing_setting` VALUES ('10002', '每笔充值费率', '2', '0', '提示： 在线充值将收取一定充值费率，例如0.6%费率,表示千分之六费率，也就是充值100元，需多支付0.6元', '2020-09-22 09:43:30', '2020-09-22 09:43:30');
INSERT INTO `marketing_setting` VALUES ('10003', '最小充值金额', '2', '0', '提示： 请输入最小充值金额,建议大于等于10元小于等于100元', '2020-09-22 09:43:30', '2020-09-22 09:43:30');
INSERT INTO `marketing_setting` VALUES ('10004', '最小提现金额', '2', '0', '提示： 请输入用户系统零钱最小提现金额，不小于最小金额方可提现。', '2020-09-22 09:43:31', '2020-09-22 09:43:31');
INSERT INTO `marketing_setting` VALUES ('10005', '最大提现金额', '2', '0', '提示： 请输入用户系统零钱最大提现金额，不大于最大金额方可提现，其中最大提现金额不可大于微信支付企业付款到零钱最大金额。', '2020-09-22 09:43:31', '2020-09-22 09:43:31');
INSERT INTO `marketing_setting` VALUES ('10006', '提现申请通知', '1', '1', '提示： 开启后商家提现时，将使用微信模板信息的方式通知平台指定的管理员。', '2020-09-22 09:43:31', '2020-09-22 09:43:31');
INSERT INTO `marketing_setting` VALUES ('10007', '提现通知微信', '3', '0', '提示： 开启提现申请通知，需填写一个接收模板消息的微信账户openid。', '2020-09-22 09:43:31', '2020-09-22 09:43:31');
INSERT INTO `marketing_setting` VALUES ('10008', '提现免审功能', '1', '0', '提示： 开启后商家提现时，平台将无需审核，商家提现的钱将直接到账。开启前请确保企业付款接口已经配置正确！', '2020-09-22 09:43:31', '2020-09-22 09:43:31');
INSERT INTO `marketing_setting` VALUES ('10009', '充值微信通知', '1', '1', '提示： 开启后商家充值成功后，将使用微信模板信息的方式通知商家的管理员。', '2020-09-22 09:43:31', '2020-09-22 09:43:31');
INSERT INTO `marketing_setting` VALUES ('10010', '客户下单通知', '1', '1', '提示： 开启后客户参加活动并购买支付后，将使用微信模板信息的方式通知商家的管理员。', '2020-09-22 09:43:31', '2020-09-22 09:43:31');
INSERT INTO `marketing_setting` VALUES ('10011', '提现成功通知', '1', 'https://www.csdn.net/gather_2c/', '提示： 开启后商家申请提现，并且由平台处理确认后，将使用微信模板信息的方式通知商家的管理员。', '2020-09-22 09:43:31', '2020-11-11 16:14:33');
INSERT INTO `marketing_setting` VALUES ('10012', '提现驳回通知', '1', 'https://www.csdn.net/gather_2c/', '提示： 开启后商家申请提现，被平台驳回后，将使用微信模板信息的方式通知商家的管理员。', '2020-09-22 09:43:31', '2020-11-11 16:14:33');
INSERT INTO `marketing_setting` VALUES ('10013', '系统主域名设置', '3', '1', '提示：系统主域名即微信公众号功能设置中的“网页授权域名”，只有在用户授权时使用，授权完成后即跳转到炮灰域名，访问后台时请使用主域名生成二维码，域名请以“http://”或“https://”开头，以“/”结尾', '2020-09-22 09:43:31', '2020-11-11 16:14:33');
INSERT INTO `marketing_setting` VALUES ('10014', '系统炮灰域名', '3', '', '提示： 可以填写多个炮灰域名，以换行隔开，域名请以“http://”或“https://”开头，以“/”结尾', '2020-09-22 09:43:31', '2020-09-22 09:43:31');
INSERT INTO `marketing_setting` VALUES ('10015', '海报/分享设置', '1', '1', '提示： 主域名：作为用户分享和专属海报的域名，如果炮灰域名出现不能正常使用时，分享和海报仍然有效。<br>提示： 炮灰域名：作为用户分享和专属海报的域名，如果炮灰域名出现不能正常使用时，主域名不受影响。', '2020-09-22 09:43:31', '2020-09-22 09:43:31');
